import React,{useState,useEffect}from 'react'
import axios from 'axios'

export default function AllTimeTables(){

    const[timetables,setTimetables]=useState([])

    useEffect(()=>{
        axios.get("http://localhost:8070/timetable/")
        .then(res=>{
            console.log(res)
            setTimetables(res.data)
        })
        .catch(err=>{
            console.log(err)
        })
    },[])
    return(
        <div className="container">
            <h1>new</h1>
            <table border='1'>
                <th>Subject</th><br/>
                <td>
                {
                    timetables.map(timetable=>(<ul key={timetable.id}>{timetable.subjectName}</ul>))
                }
                </td>
            </table>
            <a href="/add">Back</a>
        </div>
    )
}
